import Footer from "./global-components/footer";

const Service_V1 = () => {
  return (
    <div>
      <Navbar />
      <PageHeader pageTitle="Services" />

      {/* <AboutV5 /> */}
      <ServiceV1 />
      {/* <BlogSlider sectionClass="pt-120" /> */}
      {/* <CallToActionV1 /> */}
      <Footer />
    </div>
  );
};

